    },
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
  ]


  return (
    <div>
      <h2>Let's get started!</h2>
    </div>
  );
}

export default App;
